import React from 'react';
import { PRODUCTS} from './products';

const Home = () => {
  return (
    <div className="home">
      <div className="homeTitle">
        <h1>InnoCapital Shop</h1>
      </div>
      <div className="products">
        {PRODUCTS.map(product => (
          <div className="products">
            {PRODUCTS.map}
          </div>
        ))}
      </div>
    </div>
  )
}

export default Home
